import React from 'react';
import './Contacts.css'; // Assurez-vous de créer ce fichier CSS pour le style

function Contacts() {
  return (
    <div className="contacts-container">
      <h1>Contact Information</h1>
      <div className="contact-info">
        <p><strong>Téléphone:</strong> <a href="tel:+1234567890">+1 234 567 890</a></p>
        <p><strong>WebSite</strong> <a href="http://www.example.com" target="_blank" rel="noopener noreferrer">www.example.com</a></p>
        <p><strong>LinkedIn:</strong> <a href="https://www.linkedin.com/in/yourprofile" target="_blank" rel="noopener noreferrer">Your LinkedIn Profile</a></p>
        <p><strong>Email:</strong> <a href="mailto:youremail@example.com" target="_blank" rel="noopener noreferrer">youremail@example.com</a></p>
        <p><strong>GitHub:</strong> <a href="https://github.com/yourusername" target="_blank" rel="noopener noreferrer">Your GitHub Profile</a></p>
      </div>
    </div>
  );
}

export default Contacts;
